    [],nt"revision_timestamp": "2016-01-16T09:14:43.063035",nt"name": "guam-commercial-purchases-trip-ticket",nt"isopen":
    false,nt"url": null,nt"notes": "DAWR collects Trip Ticket or purchase invoice
    data from vendors that buy fish directly from the fishermen. Similar to the trip
    ticket system in Saipan, this is a voluntary program and has very few participating
    vendors. This was created by WPacFIN in the early 1980s. Data from as far back as
    July 1979 were recovered and entered into the data system as well.  DAWR-based staff
    does the main data processing for this system.  Although very few vendors participated
    in this voluntary program over the years, the most major vendor on Guam, the Guam
    Fishermen's Coop, has always participated and it is estimated that, depending on
    the year in question, between 50% and 90% of the commercial landings made on Guam
    have come through the Coop. These data are considered highly confidential.",nt"license_title":
